import React from "react";
import { Card, CardBody, CardTitle } from "reactstrap";

const Projects = () => {
  return (
    <Card
      color="dark"
      inverse
      style={{
        width: "30vw",
        height: "80vh",
      }}
    >
      <CardBody>
        <CardTitle tag="h5">Projects</CardTitle>
      </CardBody>
    </Card>
  );
};

export default Projects;
